import React, { useEffect, useState } from "react";
import oilpainting from "../../Assets/Images/oilpainting.png";
import oneline from "../../Assets/Images/oneline.png";
import styled from "styled-components";
import { getTextAPI } from "../../apis/translate";
import { changeImageAPI } from "../../apis/changeImage";
import ImageAI from "./ImageAI";

type option = {
  name: string;
  image: string;
};

const Form: React.FC = () => {
  const [selectedOption, setSelectedOption] = useState<string>(""); // Í∑∏Î¶º ÏòµÏÖò ÏÑ†ÌÉù
  const [korean, setKorean] = useState<string>(""); // Î≤àÏó≠Ìï† Î¨∏Ïû•
  const [sentence, setSentence] = useState<string>(""); // Î≤àÏó≠Îêú Î¨∏Ïû•
  const [result, setResult] = useState<string>(""); // Î≤àÏó≠ + ÌôîÌíç
  const [image, setImage] = useState(); // Î≥ÄÌôòÎêú Ïù¥ÎØ∏ÏßÄ url

  const options: option[] = [
    {
      name: "oilpainting",
      image: oilpainting,
    },
    {
      name: "oneline drawing",
      image: oneline,
    },
  ];

  // Î≥ÄÌôòÌïòÍ∏∞ Î≤ÑÌäº ÎàåÎ†ÄÏùÑ Îïå Î≤àÏó≠ Î¨∏Ïû• Î∞õÍ∏∞
  const handleSubmit = async () => {
    const data = await getTextAPI(korean);
    setSentence(data);
  };

  // Î≤àÏó≠ Î¨∏Ïû• + ÌôîÌíç Ìï©ÏπòÍ∏∞
  useEffect(() => {
    if (sentence !== "")
      setResult(result.concat(sentence, " ", selectedOption));
    console.log("‚ù§");
  }, [sentence]);

  useEffect(() => {
    if (result !== "") changeImage(result);
    console.log("üß°");
  }, [result]);

  // dall-e-2Ïóê Î¨∏Ïû• axios
  const changeImage = async (result: string) => {
    const imageUrl = await changeImageAPI(result);
    setImage(imageUrl);
    console.log(imageUrl,'üéàüéà')
  };

  return (
    <Container>
      <Title>Ïó¨Îü¨Î∂ÑÏùò ÏÉùÍ∞ÅÏùÑ Í∑∏Î¶ºÏúºÎ°ú ÎÇ®Í≤®ÎìúÎ¶ΩÎãàÎã§.</Title>
      <form>
        <Input
          type="text"
          value={korean}
          placeholder="Ï±ÖÏùÑ ÏùΩÍ≥† ÏÜåÍ∞êÏùÑ ÏûëÏÑ±Ìï¥ Î≥¥ÏÑ∏Ïöî.&#13;&#10;
        ÏòàÏãú) Îì§ÌåêÏóê ÌïÄ ÏïàÍ∞ú ÍΩÉ"
          onChange={(e) => setKorean(e.target.value)}
        />
      </form>
      <Wrapper>
        {options.map((option, idx) => (
          <Option key={idx}>
            <img src={option.image} width="80px" height="80px" />
            <OptionValue>
              <input
                type="radio"
                value={option.name}
                checked={selectedOption === option.name}
                onChange={(e) => setSelectedOption(e.target.value)}
              />
              <OptionName>{option.name}</OptionName>
            </OptionValue>
          </Option>
        ))}
      </Wrapper>

      <ImageAI imageUrl="image" size="280" />
      <ButtonContainer>
        <Button type="submit" onClick={handleSubmit}>
          Î≥ÄÌôòÌïòÍ∏∞
        </Button>
      </ButtonContainer>
      <SelectImageContainer></SelectImageContainer>
    </Container>
  );
};

const Container = styled.div`
  width: 90%;
  margin: auto;
`;

const Title = styled.div`
  color: #5c5649;
  font-weight: bold;
  margin-top: 0.3rem;
`;
const Input = styled.input`
  width: 100%;
  height: 10vh;
  margin-top: 0.4rem;
`;

const Wrapper = styled.div`
  display: flex;
  width: 100%;
  justify-content: space-around;
  margin-top: 1.2rem;
`;

const Option = styled.label`
  display: flex;
  flex-direction: column;
`;

const OptionValue = styled.div`
  display: flex;
`;
const OptionName = styled.span`
  color: #5c5649;
`;
const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 1.5rem;
`;

const Button = styled.button`
  border-radius: 1.5rem;
  border: none;
  box-shadow: rgba(0, 0, 0, 0.25) 0px 4px 8px;
  background-color: #dbd4c3;
  height: 25px;
  width: 80px;
  color: #5c5649;
`;

const SelectImageContainer = styled.div``;
export default Form;
